import React from "react";

export default function Synonyms(props) {
  if (props.synonyms) {
    return (
      <ul className='synonyms d-inline'>
        {props.synonyms.map(function (synonym, index) {
          return (
            <li key={index} className='d-inline p-3'>
              {synonym}
            </li>
          );
        })}
      </ul>
    );
  } else {
    return null;
  }
}
